import React from 'react'
import styled from "styled-components";
import TodoListItem from "../TodoListItem";

const StyledListItem = styled.li`
    text-decoration: ${props => props.done ? 'line-through' : undefined};
    list-style: none;
    padding: .75rem 1.25rem;
    border-bottom: 1px solid rgba(0,0,0,.125);
    border-color: white;
    color: white;
    &:last-of-type {
      border-bottom: none;
    }
    &:hover {
      background: rgb(6,6,6);
      background: linear-gradient(120deg, rgba(131,58,180,1) 0%, rgba(191,42,166,1) 50%, rgba(255,24,19,1) 100%);
    }
`;

const TodoList = ({ data }) => {

    const elements = data.map((value) => {
        const { id, ...valueProps } = value;
        return (
            <StyledListItem key = {id}>
                <TodoListItem {...valueProps}/>
            </StyledListItem>
        )
    });

    return (
        <TodoList>
            {elements}
        </TodoList>
    )

};

export default TodoList;
